import React from 'react';

const RenderPage = ( props ) => {
  console.log('after submit Render page : ',props.data);
  const renderData = ( ) => {
    const { movieName, ratings, duration } = props.data;
    if( props.data.length === 0 ) {
      return <tr>Loading...</tr>;
    }
    return (
          <tr>
            <td>{ movieName }</td>
            <td>{ ratings }</td>
            <td>{ duration }</td>
          </tr>
          );
  }
    return (
      <div>
        <table className="ui celled table">
            <thead>
                  <tr>
                <th>Movie Name</th>
                <th>Ratings</th>
                <th>Duration</th>
              </tr>
            </thead>
            <tbody>
                { renderData() }
            </tbody>
          </table>
      </div>
    );
}

export default RenderPage;
